import React from "react";
import ReactDOM from "react-dom";
import App from './App';
import { BrowserRouter , Route, Switch  } from "react-router-dom"
import Compa from "./Compa";

ReactDOM.render(
  <>
    <div>
       <Switch>
            <Route path="/" component = {App}/>
       </Switch>
      <BrowserRouter>
        <App></App>
        <Compa/>
      </BrowserRouter>

    </div>
  </>, document.getElementById('root')
)

